Se você está sentindo a boca seca, siga as orientações abaixo:
• aumente a ingestão de líquidos;
• mastigue bem lentamente os alimentos;
• evite comer alimentos secos, duros e crocantes;
• prepare a comida com caldos ou molhos;
• consuma frutas cítricas e com alto teor de líquidos. Exemplos: abacaxi, laranja
e morango;
• em caso de aftas, evite alimentos muito salgados e ácidos;
• se não houver aftas, chupe balas, picolés ou gelo, ou mastigue chicletes (de
preferência os de menta ou cítricos) que podem ajudar a produzir mais saliva;
•	 ingira água com gotas ou rodelas de limão.

Deixe que o paciente escolha a melhor
hora para seu banho;

Se ele puder fazê-lo sozinho, organize
todo o material necessário e coloque
próximo dele;

Não o deixe completamente só, pois ele
pode precisar de sua ajuda se algo
errado acontecer;

Verifque a temperatura da
água. O paciente pode não
perceber a temperatura, se
alguma parte do corpo dele
estiver menos sensível;

Aproveite para, depois do
banho, massagear a pele dele
com um creme hidratante;

A higiene bucal deve ser feita pela
manhã, noite e após cada refeição;
Procure uma escova de dentes bem
macia, que se adapte melhor às necessidades do paciente;
Alterações na saliva (boca seca)

Pode acontecer, principalmente se o câncer for localizado na boca e garganta. A
radioterapia e os medicamentos podem causar dores devido ao surgimento de aftas.
