• evite alimentos ácidos, picantes, muito condimentados ou salgados;
• evite alimentos duros e de difícil mastigação;
• a comida deve ser preparada na consistência que for melhor tolerada, e que
ofereça menor difculdade para mastigar ou engolir (alimentos bem cozidos,
